import logo from '../images/logo.svg';
import { Link } from 'react-router-dom';

function Header({onRegister, onSignIn, onSignOut}) {
    return(
        <header className="header">
            <img className="logo" src={logo} alt="логотип mesto" />
            {children}
            {!onRegister ? (
                <Link className='header__register' to="/sign-up">Зарегистрироваться</Link>
            ) : (
                <Link className='header__sign-in' to="/sign-in">Войти</Link>
            )}
        </header>
    )
}

export default Header;
